        super(props);
        this.state = { register: [] }
    }
    info = [];
   async componentDidMount() {
      await axios.get('https://jsonplaceholder.typicode.com/posts').then(resp => {
            this.info = resp.data
        })
       await this.setState({register:this.info});
       await console.log(this.info)

